B.Ld=new A.c8('Chicago is divided fifty legislative districts called "wards". Each ward contains roughly 50,000 redidents and elects an alderman to represent their interests on the city council. Don\'t know which ward you live in? Check out our ',null,null,B.O,null)
B.aqX=new A.c8(" they can implement across their ward. They can choose to spend money on projects that aren\u2019t on the list too. It is entirely up to alder\u2019s discretion on how and where they spend their menu funds, but some alders choose to involve the community through participatory budgeting.",null,null,B.O,null)
B.aqY=new A.c8("Participatory budgeting (PB) is a practice having the community directly decide how to spend public budgets. A typical PB process goes like this:\n        1. Residents submit PB project ideas\n        2. A group of volunteers evaluates the ideas based on need and feasibility\n        3. Residents vote on the final list of ideas to determine which ideas get funding\n        4. The ward office works with CDOT to implement the winning project ideas\n\nOnly a handful wards currently use PB budgeting, but that number is growing. \nLearn more about participatory budgeting in Chicago here: ",null,null,B.O,null)
B.aqV=new A.c8("",null,null,B.O,null)
B.a0y=A.b(s([B.aqV]),t.VO)
B.aqZ=new A.c8(null,B.a0y,null,B.O,B.c8)
B.arf=new A.c8("Reach out to your ward office!\nYou can use our Find My Ward tool to get their contact information. If your ward does participatory budgeting, ask how you can be involved. If not, don\u2019t despair! You can still contact your alder to discuss your infrastructure idea (and ask them to consider participatory budgeting).\n\nTwo pieces of advice:\n      1. Phone calls are generally more impactful than emails.\n      2. Try to find other people who care about the same issue. Convince them to contact your ward office too! Many voices have more influence than a single voice alone.\n\n                  ",null,null,B.O,null)
B.a1a=A.b(s([B.arf]),t.VO)
B.ar_=new A.c8(null,B.a1a,null,B.O,B.c8)
B.ar1=new A.c8("Sure! Our data analysis and website source code are ",null,null,B.O,null)
B.ar2=new A.c8("Since 2012, the Chicago Office of Budget and Management has published PDFs of itemized aldermanic menu spending to their ",null,null,B.O,null)
B.ar3=new A.c8(". We hope to incorporate that data into our site in the near future.\n\nThe standard menu item descriptions and cost information comes from the 2023 Neighborhood Infrastructure Menu Program packet that was sent out to ward offices.\n                  ",null,null,B.O,null)
B.ar4=new A.c8("Ward Wise is a group of civic technologists who want to keep aldermen accountable and educate Chicago residents on how money is spent in their wards. We've collected more than 10 years of ward spending. On this site you can find a break down of ",null,null,B.O,null)
B.ar6=new A.c8("Menu items that make streets safer are denoted with the Vision Zero logo in the menu item list. Vision Zero is an effort to bring the number of yearly traffic fatalities down to zero. You can learn more here: ",null,null,B.O,null)
B.ar7=new A.c8("The city of Chicago is divided into 50 legislative areas, called \u201cwards\u201d. Each ward contains roughly 50,000 residents and can overlap with multiple neighborhoods. Ward boundaries are redrawn every 8 years and were last redrawn in 2023.\n\nSee the list of wards:\n",null,null,B.O,null)
B.ar9=new A.c8(". Our site is using raw data extracted from these PDFs by journalist ",null,null,B.O,null)
B.arc=new A.c8(".\n\nResearcher John C. Ruf submitted a FOIA request to get aldermanic spending data going back to 2005. Those PDFs are available ",null,null,B.O,null)
B.arb=new A.c8("Ward Wise is a group of civic technologists who want to keep aldermen accountable and educate Chicago residents on how money is spent in their ward. We've collected more than 10 years of ward spending. On this site you can find a break down of ",null,null,B.O,null)
B.are=new A.c8("\u201cEvery year, the City of Chicago allocates 'menu money' to each of the 50 alders to spend at their discretion on capital improvements within their ward. In the past, alders received $1.32 million a year. In 2021, the amount increased to $1.5 million.\n    Menu money funds can only be spent on capital projects and not operating costs; for example, they can fund a public bench or street repaving, but it cannot fund an after-school program or snacks. Most broadly, the money can be spent on infrastructure projects on public land. This budget is the main source of funding local infrastructure improvements like:\n         - street repaving\n         - pedestrian safety projects\n         - lighting\n         - traffic calming, and\n         - sidewalk repairs\n\u201d\nSource: ",null,null,B.O,null)
B.f5=new A.c8(".",null,null,B.O,null)
B.arg=new A.c8("Alders are provided ",null,null,B.O,null)
B.arh=new A.c8("Each ward elects an alder, who is essentially a mini-mayor. They provide ward services and vote on citywide legislation in the Chicago City Council.\n\nLearn more about what an alder does:\n",null,null,B.O,null)
B.Le=new A.c8("Each year Chicago provides aldermen with $1.5 million to spend on infrustructure improvements in their ward. The money must be spent on specific improvements approved by the city, known as menu items. Menu items include things like street resurfacing, bike lines, and street lights. Learn more about menu items ",null,null,B.O,null)
B.ari=new A.c8("See our ",null,null,B.O,null)
B.arj=new A.c8(". We meet every Tuesday night.",null,null,B.O,null)
